def calculate_minimum_vehicles(timetable):
    if not timetable:
        return 0
    timetable.sort(key=lambda x: x[0])
    usecar = 1
    returntime = []
    for (dept, ariv) in timetable:
        new = True
        for ariv_time in returntime:
            if ariv_time <= dept:
                new = False
                returntime.remove(ariv_time)
                break
        if new:
            usecar += 1
        returntime.append(ariv)
    return usecar

